import React from 'react';

function ProductList() {
  const products = [
    { id: 1, name: 'iPhone 14', price: '$799' },
    { id: 2, name: 'Galaxy S23', price: '$749' },
    { id: 3, name: 'Pixel 7', price: '$699' },
  ];

  return (
    <table className="product-table">
      <thead>
        <tr>
          <th>ID</th>
          <th>Name</th>
          <th>Price</th>
        </tr>
      </thead>
      <tbody>
        {products.map((p) => (
          <tr key={p.id}>
            <td>{p.id}</td>
            <td>{p.name}</td>
            <td>{p.price}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default ProductList;
